import Table from 'react-bootstrap/Table';

import './ResultTable.styles.scss';

const ResultTable = ({ tableData }) => {
  return (
    <Table hover bsPrefix="table" className="gx-4 py-10 gy-10">
      <thead>
        <tr className="gy-5">
          <th scope="col" className="px-5 gy-5">
            Strutture
          </th>
          <th scope="col">Tipo</th>
          <th scope="col">Descrizione</th>
          <th scope="col">Revisione</th>
          <th scope="col">Data</th>
          <th scope="col" className="px-5">
            Azione
          </th>
        </tr>
      </thead>
      <tbody>
        {tableData.map((singleData) => {
          const {
            id,
            struttura,
            tipoDocumento,
            descrizione,
            revisione,
            data,
            link,
          } = singleData;
          return (
            <tr key={id}>
              <td className="px-5">{struttura}</td>
              <td>{tipoDocumento}</td>
              <td>{descrizione}</td>
              <td>{revisione}</td>
              <td>{data}</td>
              <td className="px-5">
                <a href={link} download>
                  <button>Scarica pdf</button>
                </a>
              </td>
            </tr>
          );
        })}
      </tbody>
    </Table>
  );
};

export default ResultTable;
